# depending on UP or DOWN in base_plot, we score either UP or DOWN in
# validation, so out of 3 available plots, we just score 2 of them. the ones
# scored get the scored col set to True

for ENSG in DF_aggr.reset_index()['ENSG'].value_counts().index.to_list():
    for count_type in ['norm_count', 'nt_count', 'raw_count']:
        for UP_or_DOWN in ['UP', 'DOWN']:
            for thresh in thresholds:
                try:
                    if len(DF_aggr.loc[(ENSG, count_type, ['base_plot', f'{UP_or_DOWN}_validation'], thresh, UP_or_DOWN),:]) == 2:
                        sum_ =  DF_aggr.loc[(ENSG, count_type, ['base_plot', f'{UP_or_DOWN}_validation'], thresh, UP_or_DOWN), 'p_value'].sum()
                        DF_aggr.loc[(ENSG, count_type, ['base_plot', f'{UP_or_DOWN}_validation'], thresh, UP_or_DOWN), 'p_sum'] = sum_
                        DF_aggr.loc[(ENSG, count_type, ['base_plot', f'{UP_or_DOWN}_validation'], thresh, UP_or_DOWN), 'scored'] = True
                    else:
                        continue
                except Exception as e:
                    # print(e)
                    continue

